import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home/Home';
import EquipmentList from './components/EquipmentList/EquipmentList';
import EquipmentStatus from './components/EquipmentStatus/EquipmentStatus';

function App() {
  return (


      <Router>
        <Home/>

        <Routes>
          <Route exact path="/" component={Home} />
          <Route exact path="./components/EquipmentList/equipment-list.js" component={EquipmentList} />
          <Route exact path="./components/EquipmentStatus/equipment-status.js" component={EquipmentStatus} />
        </Routes>
      </Router>
  );
}

export default App;
